package com.liu.LeetCode.First.test;

import static com.liu.LeetCode.First.exercise.LC389_FindTheDifference.getFindTheDifferenceMy1;

/**
 * Created by baidu on 2017/9/14.
 */
public class LC389_FindTheDifferenceTest {

    public static void main(String[] args) {
        String[] strings = {
                "abcd",
                ""
        };
        String[] targets = {
                "abcde",
                ""
        };
        long startTime;
        char result;
        long endTime;

        for (int i = 0; i < strings.length; i++) {
            String s = strings[i];
            String t = targets[i];
            startTime = System.currentTimeMillis();
            result = testAnswer1(s, t);
            endTime = System.currentTimeMillis();
            System.out.println("FindTheDifference My 1 result " + result + " during time " + (endTime - startTime));
        }
    }

    private static char testAnswer1(String s, String t) {
        return getFindTheDifferenceMy1(s, t);
    }
}
